import { CircularProgress, Stack, Box } from '@mui/material'
import React from 'react'
import './loader'

const Loader = () => {
return (
    <Box sx={{background: 'gray'}} minHeight={'90vh'}>
        <Stack 
            direction={'row'}
            justifyContent={'spece-between'}
            alignItems={'center'}
            height={'100%'}
        >
            <CircularProgress />
        </Stack>
    </Box>
)
}

export default Loader
